import {StyleSheet} from 'react-native'

const styles = StyleSheet.create({

    test: {
        textAlign: 'center',
        color:'blue',
        backgroundColor:'#fff'
    },
    container: {
        flex: 1,
        backgroundColor: '#fff',
    },
        contentContainer: {
        paddingTop: 30,
    },
    welcomeContainer: {
        alignItems: 'center',
        marginTop: 10,
        marginBottom: 20,
    },
    logout: {
        color: 'red',
        textAlign: 'right',
        backgroundColor: '#F5F5F5'
    }
});

export default styles;
